import React, { Component } from 'react';
import Reactotron from 'reactotron-react-js';
import './ShiftDetails.css'

// const styles = {
//     header: {
//         color: 'red',
//     }
// }

class ShiftDetails extends Component {

    listData = (props) => {
        return props.map((item) => {
            return( 
                <div className="grid"key={item.number}>
                    <span>
                        <strong>Start Time</strong>
                    </span>
                    <span>
                        <strong>End Time</strong>
                    </span>
                     <span>
                        <strong>Temperature</strong>
                    </span>
                    <span>
                        <strong>Wind Speed</strong>
                    </span>
                    <span>
                        <strong>Detailed Forecast</strong>
                    </span> 
                        <span>startTime: {item.startTime}</span>
                        <span>endTime: {item.endTime}</span>
                        <span>temperature: {item.temperature}</span>
                        <span>wind Speed: {item.windSpeed}</span>
                        <span>detailedForecast: {item.detailedForecast}</span>

                </div>
            )
        })
    }

    render(){
        Reactotron.log('this.props', this.props)
        console.log('this.props', this.props)
        const { weatherData } = this.props;
        return (
        <div>
            {this.listData(weatherData)}
        </div>
        )
    }
}

export default ShiftDetails;
